import { BrowserRouter, Link, Route, Routes } from 'react-router-dom';
import { ShowTodo } from './components/showTodo';
import { CreateTodo} from './components/createTodo';
import './App.css';



function App() {
  return (
    <div className="App">
      <BrowserRouter>

          <Link exact path="/" component={ShowTodo} />
          <Link path="/create-todo" component={CreateTodo} />


      </BrowserRouter>
    </div>
  );
}

export default App;
